import React, { Component }from "react";

class Subject extends Component {
  render() {
    console.log("Subject render");
    return(
      <header>
        <h1>
          <a href="/" onClick={function(e){
            e.preventDefault(); // 링크를 클릭했을 때  페이지가 바뀌는 것을 방지
            this.props.onChangePage(); // 클릭 이벤트 발생시키기 위한 함수 호출
          }.bind(this)}>
            {this.props.title}
          </a>
        </h1>
        {this.props.sub}
      </header>
    );
  }
}

export default Subject;
